import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from "./Home.js"
import React from "react"

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path='/' exact element={<Home />} />
      </Routes>
    </Router>
  );
}

export default App;
